export function renderPosts(postsToRender) {
    const postsContainer = document.querySelector(".references-container-content");
    postsContainer.innerHTML = "";

    postsToRender.forEach(function (post) {
        postsContainer.innerHTML += `<div class="team">
                                        <h4>${post.full_name}</h4>
                                    </div>`;
    });
}
